const styles = {

    container: {
        flex: 1,
        padding: 32,
        //backgroundColor: 'red'
        backgroundColor: '#F0F0F5'
    },

    button: {
        backgroundColor: '#ff007f',
        height: 60,
        flexDirection: 'row',
        borderRadius: 50,
        overflow: 'hidden',
        alignItems: 'center',
        marginTop: 8,
    },
}

export default styles;
